function validateNewWords() {
    tryToRemoveArrow();
    arrowposition = [];
    let lettersontheboard = collectNewLettersOnBoard();
    if (lettersontheboard.length == 0) {
        pass1();
    } else {
        let direction = decideDirection(lettersontheboard);
        if (direction == "nem esnek egy vonalba") {
            displayMessage("Szabálytalan!", "A lerakott betűk nem esnek egy vonalba.", destroyPopup, "");
            return;
        }
        if (!continuous(lettersontheboard, direction) || direction == "nem folyamatos") {
            displayMessage("Szabálytalan!", "A betűk nem folyamatosan vannak lerakva.", destroyPopup, "");
            return;
        }
        let words = getAllString(lettersontheboard, direction);
        let notfound = checkDictionary(words);
        if (notfound.length > 0) {
            let nfjoined = notfound.join(', ');
            displayMessage("Szabálytalan!", `${nfjoined} nem található a szótárban`, destroyPopup, "");
            return;
        }
        let sc = displayScore(lettersontheboard.length);
        let lobvalues = [];
        for (let letter of lettersontheboard) {
            lobvalues.push(letter[0].value);
        }
        wordsingame.push([words, lobvalues, [sc.toString()]])
        setStateOfLetters();
    }
    if (isFilledOut() == 1) {
        endOfGame();
    }
    if (ingame) {
        emptyRack();
        loadRack();
        clearInterval(timeout);
        resetTimer(timelimit);
    }
}

function isFilledOut() {
    let emptyfields = 0;
    let occupiedfields = 0;
    for (let i = 0; i < fields.length; i++) {
        for (let j = 0; j < fields[0].length; j++) {
            if (fields[i][j].className == "normal-field empty") {
                emptyfields++
            } else if (fields[i][j].className == "normal-field occupied") {
                occupiedfields++
            }
        }
    }
    return occupiedfields / (occupiedfields + emptyfields);
}

function collectNewLettersOnBoard() {
    let lettersonrack = document.querySelectorAll(".letter-on-rack");
    let lettersontheboard = [];
    for (k = 0; k < lettersonrack.length; k++) {
        let found = false;
        for (rindex = 0; rindex < fields.length; rindex++) {
            let cindex = fields[rindex].indexOf(lettersonrack[k].parentElement);
            if (cindex > -1) {
                let lob = [lettersonrack[k], rindex, cindex];
                lettersontheboard.push(lob);
                found = true;
            }
            if (found) break;
        }
    }
    return lettersontheboard;
}

