function selectLanguage(language) {
    popup1.remove();
    lockOffMain_Rules_Start();
    if (language == "hun") {
        dictionary = dictionary_hun;
        letters = letters_hun;
    } else {
        dictionary = dictionary_eng;
        letters = letters_eng;
    }
    createSack();
}

function timer() {
    timeout = setInterval(displayTime, 1000);
}

function displayTime() {
    let t
    if (!touchdevice) {
        t = document.querySelector("#time");
    } else {
        t = document.querySelector("#time-top");
    }
    t.setAttribute("value", currenttime);
    manageProgressbar();
    if (currenttime == 0) {
        try {
            destroyPopup();
        } catch (err) { }
        pass1();
        if (ingame) {
            clearInterval(timeout);
            back();
            emptyRack();
            loadRack();
            resetTimer(timelimit);
        }
    }
    currenttime -= 1;
}

function resetTimer(ctime) {
    let tofturn = (timelimit - currenttime)
    totaltime += tofturn;
    let t = document.querySelector("#time");
    currenttime = ctime;
    t.setAttribute("value", currenttime);
    timer();
}

function manageProgressbar() {
    progressbar.value = currenttime;
}

function createSack() {
    for (let i = 0; i < letters.length; i++) {
        for (let j = 0; j < letters[i][1]; j++) {
            sack.push([letters[i][0], letters[i][2]]);
        }
    }
}

function adaptToChangedSize() {
    width = window.innerWidth || document.documentElement.clientWidth || document.body.clientWidth;
    height = window.innerHeight || document.documentElement.clientHeight || document.body.clientHeight;
    height > width ? orientation = "portrait" : orientation = "landscape";
    //orientation = "portrait";
    if (orientation == "portrait" && touchdevice) {
        fieldsize = Math.floor(width / 20);
        console.log("w", width, fieldsize);
    } else {
        fieldsize = Math.floor(height / 20);
        console.log("h", height, fieldsize);
    }
    fontsizeletter = Math.floor((fieldsize - 2) * 0.8).toString() + "px";
    fontsizebutton = Math.floor((fieldsize - 3) * 0.7).toString() + "px";
    fontsizelabel = Math.floor((fieldsize - 3) * 0.5).toString() + "px";
    for (let rindex = 0; rindex < fields.length; rindex++) {
        for (let cindex = 0; cindex < fields[0].length; cindex++) {
            fields[rindex][cindex].style.width = fieldsize.toString() + "px";
            fields[rindex][cindex].style.height = fieldsize.toString() + "px";
        }
    }
    for (let cindex = 0; cindex < rackfields.length; cindex++) {
        rackfields[cindex].style.width = fieldsize.toString() + "px";
        rackfields[cindex].style.height = fieldsize.toString() + "px";
    }
    let letters = document.querySelectorAll(".letter");
    for (let letter of letters) {
        letter.style.fontSize = fontsizeletter;
        letter.style.width = fieldsize.toString() + "px";
        letter.style.height = fieldsize.toString() + "px";
    }
    let dashboardtrs = document.querySelectorAll(".dashboard-tr");
    for (let tr of dashboardtrs) {
        tr.style.height = (fieldsize * 1.1).toString() + "px";
    }
    let buttons = document.querySelectorAll(".UI-button");
    for (let button of buttons) {
        button.style.fontSize = fontsizebutton;
        button.style.height = Math.floor(fieldsize * 1).toString() + "px";
        if (orientation == "portrait" && touchdevice) {
            button.style.width = Math.floor(width / 4.4).toString() + "px";
        }
    }
    let inputs = document.querySelectorAll(".UI-input");
    for (let input of inputs) {
        input.style.fontSize = fontsizebutton;
        input.style.height = Math.floor(fieldsize * 1).toString() + "px";
        if (orientation == "portrait" && touchdevice) {
            input.style.width = Math.floor(width / 4.4).toString() + "px";
        }
    }
    let labels = document.querySelectorAll("label");
    for (let label of labels) {
        label.style.fontSize = fontsizelabel;
        label.style.height = Math.floor(fieldsize * 1).toString() + "px";
    }
    try {
        document.querySelector("#arrow").style.fontSize = Math.floor((fieldsize - 2) * 0.8).toString() + "px";
    } catch (err) { }
    try {
        popup1.style.fontSize = fontsizebutton;
    } catch (err) { }
}

function adaptToTouchDevice() {
    if (touchdevice) {
        document.querySelector("#dashboard").style.display = "none";
        document.querySelector("#dashboard-top").style.display = "block";
        document.querySelector("#dashboard-bottom").style.display = "block";
        let gameres = document.querySelector("#game-results");
        gameres.style.display = "block";
        gameres.style.width = "100%";
    }
    else {
        document.querySelector("#dashboard").style.display = "inline-block";
        document.querySelector("#dashboard-top").style.display = "none";
        document.querySelector("#dashboard-bottom").style.display = "none";
    }
}

function getElementPosition(element) {
    let rect = element.getBoundingClientRect();
    return rect;
}

function initGame() {
    let div = document.createElement('div');
    if ('draggable' in div || ('ondragstart' in div && 'ondrop' in div))
        console.log("Drag and Drop API is supported!");
    touchdevice = ('ontouchstart' in document.documentElement);
    //touchdevice = true
    adaptToTouchDevice();
    window.addEventListener("resize", adaptToChangedSize);
    if (touchdevice) {
        progressbar = document.querySelector("#progress-top");
    } else {
        progressbar = document.querySelector("#progress");
    }
    bindButtons();
    drawBoard();
    drawRack();
    adaptToChangedSize();
    displaySelectLanguage();
}

initGame();